import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import Contacto from './Screens/Contacto/Contacto';
import Inicio from './Screens/Inicio/Inicio';
import Servicios from './Screens/Servicios/Servicios';
import Nosotros from './Screens/Nosotros/Nosotros';
import ProductDetail from './components/ProductDetail/ProductDetail';
import Footer from './components/Footer/Footer';
import PreguntasFrecuentes from './Screens/PreguntasFrecuentes/PreguntasFrecuentes';

function App() {
  return (
    <Router>
      <div style={{ display: "flex", flexDirection: "column", minHeight: "100vh", alignContent: "center" }}>

        <main style={{ flex: 1 }}>
          <Routes>
            {/* Home and other sections */}
            <Route path="/" element={
              <div>
                <section id="Inicio">
                  <Inicio />
                </section>
                <section id="Sevicios">
                  <Servicios />
                </section>
                <section id="PreguntasFrecuentes">
                  <PreguntasFrecuentes />
                </section>
                <section id="Contacto">
                  <Contacto />
                </section>
              </div>
            } />
            
          </Routes>
        </main>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
